import React, { useEffect, useState } from "react";
import { Container, Row } from "reactstrap";
import styled from "styled-components";
import { Link } from "react-router-dom";
import { Form, FormFeedback } from "reactstrap";
import { PoppinsNormalGraniteGray14px, PoppinsNormalPinkSwan18px, ValignTextMiddle, PoppinsNormalWhite14px,
  PoppinsNormalEerieBlack24px, PoppinsNormalGraniteGray18px, Border1pxBlack2, PoppinsNormalBlack36px,
  PoppinsNormalBlack24px, Poppins2NormalPeachCream18px, Poppins2NormalPinkSwan18px } from "../styledMixins";
import { useFormik } from "formik";
import * as Yup from "yup";

import "./assets/EnterOTP";
import "./assets/styleguide";
import Header from "./pages/layout/Header";
import '../globals';

function LetsBegin(props) {

  const overlapGroup4 = "https://anima-uploads.s3.amazonaws.com/projects/61f1387fa60ef2351d70a102/releases/61f13d9de0abd9b62d68ae45/img/bg-card-7@1x.png";
  const button = "https://anima-uploads.s3.amazonaws.com/projects/61f1387fa60ef2351d70a102/releases/61f13d9de0abd9b62d68ae45/img/button-3@2x.png";

  const [mobile, setMobile] = useState();

  const validation = useFormik({
      // enableReinitialize : use this flag when initial values needs to be changed
      enableReinitialize: true,
    
      initialValues: {
        mobile: mobile || ""
      },

      validationSchema: Yup.object({
        mobile: Yup.string().required(
          "Please Enter Mobile Number"
        ),
      }),
      onSubmit: (values) => {

        const requestOptions = {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ mobile: values.mobile, country_code: '91' })
      };
      fetch('https://xwpo-c4qw-zxn1.m2.xano.io/api:FJSLfV81/auth/request-otp', requestOptions)
          // .then(response => response.json())
          // .then(data => setPostId(data.id));
          .then(console.log(response));

      }
  });


  return (
    <div className="container-center-horizontal">
      <div className="w1-a3-enter-otp screen" name="form1" action="form1" method="post">
      
      <Header/>

      <div className="OverlapGroup4" style={{ backgroundImage: `url(${overlapGroup4})` }}>
          <div className="OverlapGroup5">
            <div className="InputBox">

              <div className="HeaderText1">
                <h1 className="Title1">let’s begin!</h1>
                <div className="FillText"><>please enter your mobile number. <br />it will be kept private &amp; secure.</></div>
              </div>
              
              <Form onSubmit={(e) => { e.preventDefault(); validation.handleSubmit();  return false; }}>
                  <div className="Group38824">
                    <div className="Number">
                      <div className="Text1">+91</div>
                      <input className="inputfield" 
                        name="mobile" 
                        placeholder="9xxxxxxxx" 
                        type="text" 
                        autoComplete="off" 
                        onChange={validation.handleChange}
                        onBlur={validation.handleBlur}
                        value={validation.values.mobile || ""}
                        invalid={
                          validation.touched.mobile && validation.errors.mobile ? true : false
                        } required />
                        { validation.touched.mobile && validation.errors.mobile ? (
                          <FormFeedback type="invalid">{validation.errors.mobile}</FormFeedback>
                        ) : null}
                    </div>
                  </div>
                  <div className="btn-wrap text-center">
                    <button type="submit" className="sbtButton">Generate OTP</button>
                  </div>
              </Form>

            </div>
            <div className="Text4">booked cues will be available on cue app</div>
          </div>
      </div>


      </div>
    </div>
  );
}

export default LetsBegin;
